import React, { Component } from "react";

class Review extends Component {
  render() {
    const { rating, author, body, publish_date } = this.props;

    return (
      <div>
        <h4>Rating: {rating}</h4>
        <ul>
          <li>Author: {author}</li>
          <li>Body: {body}</li>
          <li>Publish Date: {publish_date}</li>
        </ul>
      </div>
    );
  }
}

export default Review;
